MATCH (e:Encounter)-[:RELATED]->(a:Allergy) 
WHERE a.code = '29046' 
RETURN DISTINCT e.id;

MATCH (p:Patient)<-[r:TAKES]-(m:Medication)
WHERE m.name = 'amLODIPine 2.5 MG Oral Tablet'
RETURN p.name;

MATCH (p:Patient) - [:HAS_OBSERVATION]-> (o:Observation)
WHERE o.type = 'Hematocrit [Volume Fraction] of Blood by Automated count'
RETURN DISTINCT p.id AS patientId, p.givenName AS patientGivenName, p.familyName AS patientFamilyName;

MATCH (p:Patient)
WHERE EXISTS(p.prescription -[:HAS_MEDICATION]-> (m:Medication {name: 'lisinopril 10 MG Oral Tablet'}))
RETURN DISTINCT p.name;

MATCH (p:Payer {id: '8fa6c185-e44e-3e34-8bd8-39be8694f4ce'}) RETURN COUNT(DISTINCT i.code) AS uncovered_immunizations 
            FROM (p)-[:PAYS_FOR]->(i:Immunization) 
            WHERE NOT i.code IN {(p)-[:PAYS_FOR]->(:Immunization)}

MATCH (e:Encounter)<-[r:HAS_IMUN]-(i:Immunization) 
WHERE i.description = 'Influenza seasonal injectable preservative free' 
RETURN e.description, e.date;

MATCH (p:Patient)-[:HAS_ALLERGY|:HAD_ALLERGY]-(a:Allergy)
            WHERE a.code = '419199007'
            RETURN COUNT(DISTINCT p);

MATCH (e:Encounter)-[r:REL_ENCOUNTER_ALLERGY]->(a:Allergy) 
WHERE a.code = '3718001' 
RETURN e.encounterId, encounterDatetime, patient.firstName, patient.lastName;

MATCH (m:Medication)
WHERE m.payer = 'Medicare'
RETURN COUNT(DISTINCT id(m)) AS NumOfUncoveredMedications;

MATCH (p:Patient)-[:HAS_PAYER]->(py:Payer) 
WHERE py.id = 'df166300-5a78-3502-a46a-832842197811'
RETURN p.name, p.id;

MATCH (e:Encounter)<-[:PROVIDES]-(h:Hospice) 
WHERE h.name = 'HOSPICE SERVICES OF WESTERN & CENTRAL MASS' 
RETURN e.id;

MATCH (p:Patient)
WHERE p.condition.code = '422650009'
RETURN p.name, p.age;

MATCH (p:Payer)-[:PAID_FOR]->(m:Medication)
WHERE m.name = 'amLODIPine 2.5 MG Oral Tablet'
RETURN p.name;

MATCH (m:MedicationAdministration) 
WHERE m.medication.name = 'Hydrochlorothiazide 25 MG Oral Tablet' 
RETURN DISTINCT m.encounter;

MATCH (c:Claim) 
WHERE c.'Claim ID'='dc27451f-105a-09fe-78e7-542e43e82686' 
RETURN c.'Claim ID';

MATCH(p:Patient)-[:MEDICATION]->(m:Medication)
WHERE m.name='Acetaminophen 300 MG / Hydrocodone Bitartrate 5 MG Oral Tablet'
RETURN p.name;

MATCH (ps:Patient)-[rs:HAS_STUDY]->(is:ImagingStudy) 
WHERE is.id = '9bda6d29-00c0-24ea-6d31-09c04803fff4' 
RETURN ps.firstName, ps.lastName;

MATCH (e:Encounter)--(cp:CarePlan)
WHERE cp.description = 'Infectious disease care plan (record artifact)'
RETURN e.id;

MATCH (p:Payer)-[:MADE_PAYMENT]->(o:Order)<-[:FOR_MEDICATION]-(m:Medication)
WHERE m.name = 'tramadol hydrochloride 50 MG Oral Tablet'
RETURN p.name;

MATCH (p:Patient) 
WHERE p.condition = 'Part-time employment (finding)'
RETURN p.displayName;

MATCH (p:Patient)--(ds:DeviceSettings) 
WHERE type(ds) = 'Blood glucose meter'
RETURN DISTINCT p.firstName, p.lastName;

MATCH (p:Patient)
WHERE p.diagnoses CONTAINS 'Latex (substance)'
RETURN count(DISTINCT p);

MATCH (n:Patient)-[:MEMBER_OF]->(org:Organization) 
WHERE org.id = 'f6ba791e-fe68-3596-bef4-60751db6a60e' 
RETURN DISTINCT n.name;

MATCH (p:Person)
RETURN  p.name
WHERE p.immunizationCodes CONTAINS '140';

MATCH (p:Patient)<-[received:HAS_RECEIVED]-(v:Vaccine)
WHERE v.name = 'SARS-COV-2 (COVID-19) vaccine  mRNA  spike protein  LNP  preservative free  100 mcg/0.5mL dose'
RETURN DISTINCT p.name, received.date;

MATCH (e:Employee)
WHERE e.has_promotion = true OR e.has_transfer = true
RETURN count(e);

MATCH (e:Encounter)
WHERE e.procedure = 'Depression screening (procedure)'
RETURN DISTINCT e.id;

MATCH (p:Patient) - [r:HAS_STUDY]-> (s:Study) 
WHERE s.series_uid = '1.2.840.99999999.1.92171424.1685558506026' 
RETURN p.name, p.dob;

MATCH (e:Immunization)-[:RELATES_TO]->(en:Encounter) 
WHERE e.description =~ 'Hep B  adult' 
RETURN en;

MATCH (e:Encounter)--(s:Supply)
WHERE s.name="Air filter device (physical object)"
RETURN e.name;

MATCH (p:Person)
WHERE p.condition = 'Full-time employment (finding)'
RETURN p.name;

MATCH (p:Patient)-[:HAS_IMMUNIZATION]->(i:Immunization) 
WHERE i.code = '140' 
RETURN p.id, p.name;
